import React from 'react'
import { Outlet } from 'react-router-dom'
import Dashboard from '../../components/Dashboard'

function Adminhome() {
  return (
    <div className='maincontainer'>
      <h1>Admin Page</h1>
      /*<Dashboard/> */
      <div className='dashmain' onScroll={true}>
         <Outlet/>
      </div>
    </div>
  )
}

export default Adminhome
